import React from "react";
import {makeStyles} from "@material-ui/core/styles";
import Container from "@material-ui/core/Container";
import Link from "@material-ui/core/Link";
import IconButton from "@material-ui/core/IconButton";
import Badge from "@material-ui/core/Badge";
import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import FavoriteIcon from "@material-ui/icons/Favorite";

const useStyles = makeStyles({
    footer: {
        background: "black",
        color: "white",
        padding: "15px 0"
    },
    containerBox: {
        // padding: "10px 25px"
    }
});

export default () => {

    const classes = useStyles();

    return (
        <div className={classes.footer}>
            <Container maxWidth="lg" className={classes.containerBox}>
                <div>
                    <Link href="/cart" className={classes.cartIcon}>
                        <IconButton aria-label="show 2 product" color="inherit">
                            <Badge badgeContent={2} color="error">
                                <MailIcon />
                            </Badge>
                        </IconButton>
                    </Link>
                    <Link href="/favorits" className={classes.cartIcon}>
                        <IconButton aria-label="show 2 favorit" color="inherit">
                            <Badge badgeContent={1} color="error">
                                <FavoriteIcon />
                            </Badge>
                        </IconButton>
                    </Link>
                    <Link href="/favorits" className={classes.cartIcon}>
                        <IconButton aria-label="show 2 favorit" color="inherit">
                            <Badge badgeContent={1} color="error">
                                <FavoriteIcon />
                            </Badge>
                        </IconButton>
                    </Link>
                </div>
            </Container>
        </div>
    )
}
